    id: 78,
    nameRU: 'Ли Скретч Перри: Виденье рая',
    nameEN: 'Lee Scratch Perry’s Vision of Paradise',
    director: 'Фолькер Шанер',
    country: 'Германия, Великобритания, Швейцария, Ямайка, Эфиопия',
    year: '2015',
    duration: 100,
    description:
      'Перед тем как стать человеком, он был рыбой. Сейчас Ли «Скретч» Перри называет себя не иначе как Ноем. Его религия — его сердце; его законы просты — ганджа должна быть свободной, а бога нужно развлекать. Он продюсировал Боба Марли и писал альбом с The Orb, работал с Китом Ричардсом, Beastie Boys и Дэвидом Линчем, научил многих музыкантов пользоваться студией как инструментом и выпустил не один грандиозный даб-альбом. Он разговаривает с коровой и каждое утро вслух приветствует свой компьютер, кружится с раскинутыми руками вокруг Букингемского дворца и напоминает, что все тени одного цвета. «Visions of Paradise» — это документальная сказка по мотивам 13 лет, проведенных немецким режиссером Фолькером Шанером в компании Ли Перри, от Ямайки и Эфиопии до Швейцарии и Лондона. Герой в ней предстает то ли поехавшим дедом, рассуждающим о космических путешествиях, то ли настоящим магом. То есть, вообще говоря, как тем, так и другим.',
    trailerLink: 'https://www.youtube.com/watch?v=9mvjnZAgUNA',
