    description:
      'В молодости один владелец магазина заявил ей, что она не очень красивая, но это не так уж важно, поскольку у нее «есть стиль — и это гораздо лучше». За все следующие годы Айрис Апфель, которая не покладая рук работает в моде с 50-х и которой на момент показа будет 93 года, ни разу не опровергла это утверждение о стиле. Круглые очки и гигантские украшения, бесконечные гардеробы, обложка Dazed и Дрис ван Нотен с Канье Уэстом в поклонниках — все это Айрис. А еще у нее есть столетний муж Карл, с которым Айрис вместе с 1948-го, так что ее слова «Гораздо важнее быть счастливым, чем хорошо одетым», — это ничуть не лукавство: вот уж кто знает, о чем говорит. Не менее важный герой фильма — его режиссер Альберт Мейзелс, автор «Серых садов» и «Gimme Shelter» о The Rolling Stones, скончавшийся в этом году в 83 года. «Iris» стал одним из его последних фильмов — он следовал за героиней по всему Манхэттену, добавив интервью ее почитателей и кадры с «Никона» и 16-миллиметровой кинопленки из семейного архива.',
