    id: 85,
    nameRU: 'Слушая Москву',
    nameEN: 'Machine translate: Listening to Moscow',
    director: 'Иван Проскуряков',
    country: 'Россия',
    year: '2015',
    duration: 25,
    description:
      'Москва стала домом и сценой для артистов из самых разных точек планеты. Музыка в этом городе звучит, не прекращаясь: венесуэлец-космополит, осевший в Москве, готовит презентацию альбома своей группы – важное событие андерграундной рок-сцены. Китаянка-пианистка из Консерватории, влюблённая в Рахманинова, готовится к серьёзному экзамену. Американка и казах экспериментируют с форматами и ищут слушателя среди соседей по подъезду, приглашая их на квартирник. Ансамбль кубинцев в очередной раз выходит на сцену ресторана с национальными песнями и плясками. Ганаянец-барабанщик играет вместе с госпел-хором на протестантской службе. Каждый из них существует в своих маленьких – доступных слушателю – мирах; и из этих миров и состоит музыкальный ландшафт Москвы.',
