    id: 90,
    nameRU: 'Златан. Начало',
    nameEN: 'Den Unge Zlatan',
    director: 'Фредрик Герттен, Магнус Герттен',
    country: 'Unknown',
    year: '2015',
    duration: 96,
    description:
      '1999 год. На стене висит газета с неоспоримым заголовком «Бекхэм – лучший в мире». Перед камерой – мало кому известный 17-летний пацан, который заявляет: «Английский футбол – дерьмо».\n\nЭто нападающий шведского клуба «Мальме» Златан Ибрагимович, огромное самомнение которого равно его футбольному таланту, только талант этот еще надо раскрыть. Всего через пару лет игры в Швеции Ибрагимович в золотом пиджаке и розовой рубашке поедет за рекордную сумму в голландский «Аякс», где будут и драки, и дисквалификации, и конфликт с капитаном команды, но будут и голы – включая один, который обязательно надо увидеть, потому что пересказать его все равно не получится. Фильм Фредрика и Магнуса Герттенов показывает, откуда взялся самый харизматичный игрок современного футбола (если что, с этим определением согласятся и Месси, и Роналду) и подробнейшим образом освещает относительно малоизвестный период его карьеры.\n\nСамое ценное здесь – невероятные архивные съемки из Швеции: клубный оператор «Мальме», снимающий с расстояния вытянутой руки, ходит за Златаном и в раздевалку, и в автобус, и к нему домой, где он режется в приставку, а также показывает, как дети выпрашивают у него бутсы, а девушки – номер телефона. Ранний этап его карьеры не обходится без трудностей, но Ибрагимович расправляется с ними примерно так же эффектно, как оставляет в дураках сразу трех защитников в дерби с «Юргорденом» в 2001 году, – и так же убедительно, как в 2016-м завоевывает 29-й трофей в своей карьере.',
