    id: 91,
    nameRU: 'Бег — это свобода',
    nameEN: 'Free to Run',
    director: 'Пьер Морат',
    country: 'Швейцария, Франция, Бельгия',
    year: '2015',
    duration: 90,
    description:
      'Сегодня мало кто помнит, что еще 50 лет назад простым бегунам приходилось быть бунтарями — места в этом спорте официально не было ни женщинам, ни любителям.\n\nСитуацию изменили 60-е годы, время борьбы за права на всех фронтах. Начиная именно с 60-х, фильм рассказывает историю бега как культурного и даже контркультурного явления, от романтических провокаций до создания огромной индустрии.\n\nГлавные герои фильма — иконы бегового движения. Кэтрин Швитцер — первая женщина-марафонец: в 1967-м она отбивалась от директора Бостонского марафона, который силой пытался столкнуть ее с дистанции. Фотография этого момента обошла обложки мировых изданий, а ее героиня впоследствии стал лицом первого марафона для женщин и комментатором первого женского забега на Олимпийских играх 1984 года. Фред Лебоу — основатель Нью-Йоркского марафона, родившегося из крохотной ассоциации бегунов-волонтеров, которые тогда даже не могли представить, что когда-нибудь оккупируют Центральный парк. В 62 года он, уже зная, что болен раком мозга, пробежал марафон в качестве символического жеста, показывая себе и друзьям, что жив. Орегонец Стив Префонтейн — рекордсмен и борец за право всех талантливых «любителей» на профессиональную карьеру; в Голливуде о нем уже сняли два фильма. Это ода бегу как проявлению воли к жизни, способу единения с природой, а марафонам — как минутам славы для каждого.',
