    year: '2015',
    duration: 136,
    description:
      'Последняя работа Адама Кертиса, пожалуй, самого известного телевизионщика в мире кино и самого неочевидного режиссера на современном британском телевидении. Эта диковатая комбинация исчерпывающе объясняет метод Кертиса: будучи штатным сотрудником BBC и имея неограниченный доступ к их архивам, он делает крайне визуальные фильмы-эссе, посвященные взаимосвязи власти, технического прогресса и их влиянию на политику и культуру, причем всегда с безупречным выбором музыки.\n\nЭто история об Афганистане и хрониках западного вмешательства на Ближнем Востоке, которое по мнению Кертиса, представляет собой череду непониманий и упрощений, раз за разом приводивших к результату, ровно противоположному планируемому. Америка защищала ваххабитов, чтобы иметь доступ к нефти Саудовской Аравии, в Афганистане строили дамбы, чтобы осушить Гильмендскую долину, таким образом готовя идеальную почву для выращивания опиумного мака. Прошлое усеяно предупреждениями, а история — это узор, только кто бы разглядел его, но сегодня история выглядит слишком сложной штукой для политиков, ее заменил сказочный миф про добро и зло, тем временем Исламское Государство желает примерно того же, чего хотели ваххабиты еще полвека назад. Фильм-провокация вызвал немало споров в Британии, но его кинематограческая ценность бесспорна — впечатляющий аудио-визуальный коллаж длиной в 137 минут, с цитатами из «Соляриса» Тарковского.',
