    id: 95,
    nameRU: 'В ожидании Б',
    nameEN: 'Waiting for B.',
    director: 'Пауло Сезар Толедо, Эбигейл Спиндел',
    country: 'Бразилия',
    year: '2015',
    duration: 71,
    description:
      '«У меня все строго, если кто-то не пришел, я его просто из очереди выкидываю, я не шучу. Нечего прогуливать, пропал надолго — привози справку от врача!» — пылко сообщает юноша в очках, который организовал очередь на концерт Бейонсе в Сан-Паоло. Точнее, небольшой палаточный городок, потому что до концерта — еще два месяца.\n\nЗа эти два месяца городок превратится в настоящий карнавал — со своими дрэг-королевами, интригами, ежевечерними сеансами уличного тверка и умельцами по пошиву эпатажных костюмов.\n\n«В ожидании Б» — удивительный документ, исследующий одновременно феномен фанатства и жизнь отдельно взятого гей-коммьюнити через истории героев фильма, разговоры за жизнь в крохотном пространстве палаток и конечно же танцы. Герои рассказывают о себе и, каждый по-своему, объясняют, почему только в Бразилии возможны такие изматывающие, но полные восторга несколько недель на улице ради двух часов живой музыки. И, конечно, танцуют. Да так, что становится совершенно неясно, зачем Бейонсе везти в Сан-Паоло собственных танцоров — ведь там есть целая преданная армия, знающая каждое ее движение наизусть.\n\nА после фильма остается то щемящее ощущение, которое бывает только при отъезде из пионерлагеря.',
