    description:
      'Олег Каравайчук – великий и загадочный композитор, живая достопримечательность Петербурга, почти мистическая личность без пола и возраста. На самом деле ему 89, но попробуйте в это поверить, глядя на этого вечного гуттаперчевого мальчика. Выходец из Венесуэлы Андрес Дюке совершил абсолютный режиссерский подвиг, уговорив вечно ускользающего Каравайчука на полноценные съемки. В геометрически выстроенных проходах по Эрмитажу Олег Николаевич – усталый путник, извлекающий энергию из искусства древних миров, того естественного «новаторства, которое не доминирует», и ценитель имперской красоты, объсняющийся в любви Екатерине, «влагалищу мироздания». В прогулках по Комарово – ворчливый и аррогантный старик, добрым словом поминающий Сталина («он выиграл войну и творчество») и мечтающий дожить до Страшного суда, когда неприятные соседи исчезнут с лица земли, а срубленные ими ели возродятся из мертвых. Но главные эпизоды – те, где Каравайчук играет свои «неудобные, но гениальные» мелодии, и руки музыканта, вступая в контакт с клавишами, будто отделяются от тела и превращаются в новый, инопланетный организм.',
