    duration: 54,
    description:
      'С десяток музыкантов сидят на полу в кругу, во главе — израильский композитор Шай Бен-Цур, чуть поодаль — Джонни Гринвуд, спрятавший лицо за длинной челкой, за кадром — Найджел Годрич, за камерой — режиссер Пол Томас Андерсон. А за окном — весна в индийском Раджастане. Люди играют музыку небесной красоты и переглядываются друг с другом — когда серьезно, когда посмеиваясь.\n\nДокументальный фильм о поездке Гринвуда, Годрича и Шай Бен-Цура в Раджастан почти целиком состоит из бесконечных репетиций в просторном зале старинного индийского форта, продуваемом всеми ветрами из открытых окон и дверей. Разбавляют их лишь кроткие интервью местных музыкантов из Rajastan Express, редкие вылазки на рынок за починкой инструментов и — в качестве внезапной шалости — пристальное внимание камеры к залетающим то и дело в помещение голубям. Но большего и не надо: достаточно просидеть в зале десять минут, чтобы понять, что все эти люди собрались в кадре ради музыки, и пока она звучит, говорить им много совершенно ни к чему.\n\n',
