    nameRU: 'Дженис: Маленькая девочка грустит',
    nameEN: 'Janis: Little Girl Blue',
    director: 'Эми Берг',
    country: 'США',
    year: '2015',
    duration: 103,
    description:
      'В родном Порт-Артуре она всегда чувствовала себя изгоем. Найдя близких по духу людей в Сан-Франциско, Дженис Джоплин стала суперзвездой — но совсем ненадолго. «Грустная маленькая девочка», один из немногих фильмов о быстрой, яркой и бурной жизни одной из главных рок-певиц в истории, сделан однажды номинировавшейся на «Оскар» Эми Берг без излишней сентиментальности, зато с большими почтением и любовью. О Джоплин нежно и без осуждения рассказывают ее друзья, родственники и игравшие с ней музыканты. Они вспоминают, как Дженис при первой встрече с Бобом Диланом заявила ему, что тоже станет знаменитой; как она не могла понять, почему не получается стать такой же, как все — и слава богу; как любила вообще весь мир — и почему это было проблемой. В перерывах между интервью — песни, записи концертов, бешеная энергетика которых прорывается через экран, и голос Кэт Пауэр, читающий письма, которые Дженис успела написать за свои 27.',
