    nameRU: 'Зигги Звёздная Пыль и пауки с Марса',
    nameEN: ' Ziggy Stardust and the Spiders from Mars',
    director: ' Д.А. Пеннебейкер',
    country: 'Великобритания',
    year: '1973',
    duration: 90,
    description:
      '3 июля 1973 года Дэвид Боуи вышел на сцену лондонского Hammersmith Odeon, чтобы дать свой последний концерт в образе Зигги Стардаста. О том, что это прощальное выступление космического мессии, не знал заранее никто, включая музыкантов группы и режиссера Д.А. Пеннбейкера, который вообще-то пришел туда снять двадцатиминутный промофильм, но, увидев Боуи на сцене, остался и запечатлел все, включая бесчисленные наряды артиста и полуживые от счастья толпы фанатов в партере.\n\n«Зигги Стардаст» — это памятник на экране, созданный при жизни, почти случайная и вполне удачная попытка ухватить лицо героя, постоянно меняющего обличье. Ставший сегодня классикой документального кино концертный фильм Пеннебейкер в итоге разбавил лишь несколькими дублями артиста за сценой. Их, впрочем, достаточно для того, чтобы обозначить тот самый зазор, который создавал в Боуи бешеный магнетизм — зазор между персонажем и человеком, от которого трудно отвести взгляд.',
