    id: 101,
    nameRU: 'SOS матросу!',
    nameEN: 'Vladivostok Vacation and the Great Russian Break',
    director: 'Дэнни Дрисдейл',
    country: 'США, Россия',
    year: '2016',
    duration: 50,
    description:
      'Возможно, первый в мире фильм в жанре документальной музыкальной фантасмагории, «SOS Матросу!» – это рок-н-ролльное безумие в традициях «Help!», но под парусом, на всех широтах, в мире, в котором Желтая подводная лодка, наконец, встретилась с капитаном Врунгелем.\n\nВсе начинается в порту Владивостока. Музыкант Илья, решивший, что его группе тесен родной город, мечтает о международном признании, особенно – о премии «Грэмми». Его жизнь меняет случайная встреча с капитаном парусного судна, который предлагает музыканту место на борту. Вскоре Илья и его товарищи по группе – Олег, Юрий и Евгений – оказываются в настоящем кругосветном путешествии. Маршрут прост: «побывать в тех местах, где любят рок-н-ролл!»\n\nНо не все так просто, как кажется на первый взгляд. Поэтичный гитарист Юрий не жалует море, мечтает быстрее покинуть корабль и коротает время за стаканом. Барабанщик Олег, наоборот, начинает с удовольствием выполнять все матросские обязанности. Мечтательный бас-гитарист Евгений ищет золотую рыбку, которая исполнила бы все его желания. Тем временем мистер Spoon, друг детства героев, спонтанно решивший стать их менеджером, тоже поднимается на борт – что сыграет роковую роль в судьбе коллектива.\nТем временем за бортом сменяют друг друга Китай, Корея, Япония, Южная Африка, Лос-Анджелес. Запись новых песен прямо в каюте, концерты на улицах морских портов и неожиданные встречи. Добьются ли музыканты своего, поймают ли золотую рыбку и вынесут ли испытание морем?',
